import css from 'styled-jsx/css';

export default css`.carousel {
  min-width: 1190px;
  height: 400px;
  transition: background-color 0.3s linear;
}
.carousel .banner-layout {
  position: relative;
}
.carousel .banner-layout .banner-wrap {
  position: absolute;
  left: 190px;
  top: 0;
  width: 710px;
  height: 400px;
  background-color: #fff;
}
.carousel .banner-layout .banner-wrap .banner-item {
  height: 400px;
}
.carousel .banner-layout .banner-wrap .banner-item img {
  height: 100%;
  width: 100%;
}
.carousel :global(.hhb-dot) {
  bottom: 10px;
}
.carousel .login-card-wrap .login-card-layout {
  position: relative;
}
.carousel .login-card-wrap .login-card-layout div {
  position: absolute;
  top: 0;
  right: 0;
  z-index: 1;
}
`
